import React from "react";
import ExpencseDes from "../main/components/ExpencseDes";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const ExpenseSection = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };
  return (
    <div id="images" className="w-full">
      <div className="bg-[#F6F7F9] flex justify-evenly mt-24 h-[426px]">
        <div className="flex flex-col mr-20">
          <h1 className="text-[#ADB3BE] contrast-50 font-semibold mt-24">
            SAVE TIME AND MONEY
          </h1>
          <p className="text-[#050F4E] text-4xl mt-4">
            Find My Trials reduce expences, accelerate <br />
            research, and yield quicker advancements, <br />
            ultimately saving both time and money.
          </p>
        </div>
        <div className="mt-24">
          <img src="images/Group.png" alt="group" />
        </div>
        <div className="mt-24">
          <img src="images/Group1.png" alt="group" />
        </div>
      </div>
      <Slider {...settings} className=" absolute bottom-28">
        {[1, 2, 3].map((index) => (
          <div key={index}>
            <ExpencseDes />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default ExpenseSection;
